const UserEntry = () => {
    return (
        <div className="UserEntry">
            <div className="Component">
                <div class="formgroup" id="name-form">
                    <label for="name">Your name*</label>
                    <input type="text" id="name" name="name" />
                </div>
            </div>
        </div>
    );
};

export default UserEntry;
